import React from 'react';
import logo from './icons/logobk.png';
import './Navigation.css';
const Navigation = () => {
  return (
    <>
      <div>
        <img src={logo} alt="Logo" width="45" />
        <h3>enus</h3>
      </div>
    </>
  );
};

export default Navigation;
